(9,23,'<p><span style=\"font-family:Georgia; font-size:10.0000pt\">List the primary job duties and responsibilities using headings and then give examples of the types of activities under each heading. Using headings and giving examples of the types of activities to be done allows you to develop a flexible job description that encourages employee to &lsquo;work outside the box&rsquo; and within reason, discourages &ldquo;that&rsquo;s not my job&rdquo;.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Identify between three and eight primary duties and responsibilities for the position</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">List the primary duties and responsibilities in order of importance</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Begin each statement with an action verb</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use the present tense of verbs</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use gender neutral language such as s/he</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use generic language such a photocopy instead of Xerox</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Where appropriate use qualifiers to clarify the task &ndash; where, when, why or how often &ndash; for example instead of &ldquo;greet visitor to the office&rdquo; use &ldquo;greet visitors to the office in a professional and friendly manner&rdquo;</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Avoid words that are open to interpretation &ndash; for example instead of &ldquo;handle incoming mail&rdquo; use &ldquo;sort and distribute incoming mail&rdquo;</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">asdfadfads</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">adfadf</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">adfasdf</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">asddfasdf</span></p>',1,'2019-01-28 11:08:07','2019-01-28 11:08:07','1',NULL,'GD',50),
(10,24,'<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><strong><u>RENTAL AGREEMENT</u></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">THIS INDENTURE of rental agreement is applicable from the 10</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;day of April, 2017 at Bangalore, between Smt. Asha at #123, Ashok Nilaya, 20</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;Cross, K.R. Layout JP Nagar 6</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;phase, Bangalore 560078. Herein after called the &lsquo;OWNER&rsquo; of the one part:</span></p>\r\n\r\n<p style=\"text-align:center\"><strong><u>AND</u></strong></p>\r\n\r\n<p style=\"text-align:justify\">Jitendra S/0 raj<span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;the Expression OWNER and TENANT wherever the context so admits shall be taken to mean and include their respective heirs, legal representatives, executors and assigns.Whereas the OWNER is the absolute owner of the house premises situated in the ground floor of &nbsp;&nbsp;#123, Ashok Nilaya, 20</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;Cross, K.R. Layout JP Nagar 6</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;phase, Bangalore 560078 and hereinafter referred to as Scheduled premises.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><u>NOW THIS AGREEMENT WITNESSETH AS FOLLOWS</u></p>\r\n\r\n<p style=\"text-align:justify\"><u>&nbsp;</u></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">1.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The Tenancy is executed for a period of 12 months and shall commence from the above said date. It may be renewed for further periods with mutual consent of both the parties.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">2.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT has this day paid a sum of Rs. 50,000 (Rupees Forty Thousand only) to the OWNER by as advance before the following witnesses which sum the OWNER shall be acknowledged. This advance shall not carry any interest and is refundable to the tenant at the time of vacating the schedule premises subject to the deductions of arrears of rent, electricity charges etc, if any.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">3.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT shall pay monthly rent of Rs. 6500/- (Rupees Five thousand five hundred only) to the OWNER on or before the 10</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;of every month regularly </span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">4.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">Every year on renewal of agreement rent will be increased by 5%.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">5.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT shall also pay the electricity charges and Water charges of the schedule premises as per bills every month without keeping any arrears.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">6.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT shall under no circumstances shall sublet or underlet or in any way part with the possession of the schedule premises and Tenant will not include any other members in this present scheduled premise other than members in the agreement without written consent of the OWNER.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">7.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">In case of any damages to the schedule property the TENANT shall get it repaired at his own cost and expenses and the damages are found at the time of vacating the equivalent amount for repairing/painting will be deducted from the advance.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">8.&nbsp;</span><