(19,7,10,'<table border=\"1\" cellspacing=\"0\" class=\"table table-bordered table-hover table-striped\" id=\"table_dashboard\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; border-collapse:collapse; border-spacing:0px; border:1px solid #f4f4f4; box-sizing:border-box; color:#333333; font-family:&quot;Source Sans Pro&quot;,&quot;Helvetica Neue&quot;,Helvetica,Arial,sans-serif; font-size:12px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; margin-bottom:20px; max-width:100%; orphans:2; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; width:1099px; word-spacing:0px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-color:#f4f4f4; vertical-align:top\">agcverifier@gmail.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"background-color:#e0e0e0\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><strong><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\"><strong>Duties and responsibilities</strong></span></span></strong></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">List the primary job duties and responsibilities using headings and then give examples of the types of activities under each heading. Using headings and giving examples of the types of activities to be done allows you to develop a flexible job description that encourages employee to &lsquo;work outside the box&rsquo; and within reason, discourages &ldquo;that&rsquo;s not my job&rdquo;.</span></span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Identify between three and eight primary duties and responsibilities for the position</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">List the primary duties and responsibilities in order of importance</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Begin each statement with an action verb</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Use the present tense of verbs</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Use gender neutral language such as s/he</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Use generic language such a photocopy instead of Xerox</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Where appropriate use qualifiers to clarify the task &ndash; where, when, why or how often &ndash; for example instead of &ldquo;greet visitor to the office&rdquo; use &ldquo;greet visitors to the office in a professional and friendly manner&rdquo;</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Lucida Bright&quot;\"><span style=\"font-size:10.0000pt\"><span style=\"font-family:Georgia\">Avoid words that are open to interpretation &ndash; for example instead of &ldquo;handle incoming mail&rdquo; use &ldquo;sort and distribute incoming mail&rdquo;</span></span></span></span></li>\r\n</ul>','2019-01-28 10:17:11','1','uploads/documents/1548670630ijWeDmOXhkBS75.pdf','GF',NULL),
(24,9,5,'<p><span style=\"font-family:Georgia; font-size:10.0000pt\">List the primary job duties and responsibilities using headings and then give examples of the types of activities under each heading. Using headings and giving examples of the types of activities to be done allows you to develop a flexible job description that encourages employee to &lsquo;work outside the box&rsquo; and within reason, discourages &ldquo;that&rsquo;s not my job&rdquo;.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Identify between three and eight primary duties and responsibilities for the position</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">List the primary duties and responsibilities in order of importance</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Begin each statement with an action verb</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use the present tense of verbs</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use gender neutral language such as s/he</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Use generic language such a photocopy instead of Xerox</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Where appropriate use qualifiers to clarify the task &ndash; where, when, why or how often &ndash; for example instead of &ldquo;greet visitor to the office&rdquo; use &ldquo;greet visitors to the office in a professional and friendly manner&rdquo;</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><!--[if !supportLists]--><span style=\"font-family:Symbol; font-size:10.0000pt\">&middot;&nbsp;</span><!--[endif]--><span style=\"font-family:Georgia; font-size:10.0000pt\">Avoid words that are open to interpretation &ndash; for example instead of &ldquo;handle incoming mail&rdquo; use &ldquo;sort and distribute incoming mail&rdquo;</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">asdfadfads</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">adfadf</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">adfasdf</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt\"><span style=\"font-family:Georgia; font-size:10.0000pt\">asddfasdf</span></p>','2019-01-28 11:08:07','1',NULL,'GD',NULL),
