(26,10,5,'<p><span style=\"font-family:Georgia; font-size:10.0000pt\">GHANA<br />\r\nSHYAM<br />\r\nS</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">DESIGNER /<br />\r\nDEVELOPER</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">+91<br />\r\n97380375<br />\r\n48<br />\r\nghanashyam74@gm<br />\r\nail.com</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">In my professional career as an Engineer, it has been my motto to bridge the gap<br />\r\nbetween Creativity and Practicality and to find the perfect balance between Simplicity and<br />\r\nSophistication and to deliver the fullest of my abilities at the Center of Innovation.</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">&ldquo;</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">&rdquo;</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">outcome of this project was a result of liabilities within the Bootstrap framework and recent<br />\r\nadvancements in browser technology. In my years of developing layouts, I was able to iron out the<br />\r\nproper structured approach for generating layouts which ultimately led me to develop this framework.<br />\r\nMUSIC REMIXER ENGINE<br />\r\nThis was my final year project during my Undergraduate Study at PESIT, Bangalore. As the name insists,<br />\r\nthis project, as was intended, produced a &lsquo;Remixed&rdquo; version of an audio file input to it. This project was<br />\r\nan intense application of realtime digital signal processing methods and techniques which as a result<br />\r\nled to the creation our Realtime Audio Engine. This was later successfully morphed as an Android<br />\r\nApplication through OpenSL bindings and C++.<br />\r\nSTUDENT PLACEMENT PORTAL<br />\r\nDesigned &amp;amp; Developed the front-end for a responsive, robust web-portal for students to view<br />\r\nplacement offers forwarded by the Placement Officer, replacing the previous Mail-based system. The<br />\r\nportal embodied modern features such as dynamic loading feed achieved via Asynchronous AJAX,<br />\r\n&lsquo;Timeline&rsquo; based UI, profile management with access control, realtime statistic &lsquo;widgets&rsquo;, etc.<br />\r\nAUDIO VISUALIZER<br />\r\nDesigned &amp;amp; Developed a standalone Audio Visualizer Application using OpenGL with GLUT and FMOD<br />\r\naudio API on C++, with cross platform compatibility. This project dove deep into Digital Signal<br />\r\nProcessing and Audio Decoding. Highly responsive logarithmic scaling with low latency combined with<br />\r\ncomplex fractal shapes and color gradients resulted in this rather spectacular display of Audio<br />\r\nVisualization.<br />\r\nPROCEDURAL SIMULATION OF FLUID SURFACES USING C++ AND OPENGL<br />\r\nDeveloped a standalone OpenGL application for real-time simulation of dynamic surface topography<br />\r\nresembling hyperactive liquids using interference patterns of surface distortions following circular-sine<br />\r\nwave fronts, on a 2d surface. Physically based runtime parameters and dynamically adjusting mesh<br />\r\ntopography were a few features. High-quality surface tessellation was the result.<br />\r\nSTAT-X, A REALTIME HARDWARE MONITORING &amp;amp; REPORTING UTILITY FOR ANDROID<br />\r\nDesigned &amp;amp; Developed Stat-X, a utility that reports the CPU, Memory, Network and Process statistics to<br />\r\nthe End User in realtime. The application fetches various statistics pertaining to different hardware<br />\r\ncomponents (CPU, Memory, Modem, etc.) and the OS and normalizes these values while creating logs<br />\r\nand displays these values at the Application&rsquo;s frontend using various elements such as graphs, meters,<br />\r\nlists, etc. The application was achieved using Android Studio &amp;amp; Java platform. Various technical features<br />\r\nof the application include Heterogeneous Multi-Threaded programming, Image blending, Canvas<br />\r\ndrawing, Easing functions, etc.<br />\r\nCOMMUT - REALTIME, SCHOOL BUS TRACKING APPLICATION<br />\r\nDesigned &amp;amp; Developed, the application and web front-end while Interning at Paradigm Logic<br />\r\nTechnology Ventures Pvt. Ltd. (2015-16).<br />\r\nThe application was intended to provide on-the-fly predictions about school buses and their arrival<br />\r\ntime at a bus stop using repetitive learning and other statistical prediction techniques and a means for<br />\r\nparents to track their children during their commute back and forth to their schools. Complete with<br />\r\nmessage boards, multiple profiles and map interfaces, this application was intended to be a robust<br />\r\nimplementation. Multi-persona apps and Admin Dashboards comprised this project.</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">SEA - HIGH-GRAPHIC 3D GAME DEVELOPED IN UNITY ENGINE<br />\r\nInspired by the trend of Infinite-terrain games at the time, this was an attempt to resemble some of the<br />\r\nother popular games, at the time. This was a fast paced, first person, &lsquo;Infinite-runner&rsquo; type game where<br />\r\nyou surfed the waves avoiding obstacles to achieve a high score. High fidelity graphics and advanced<br />\r\nOpenGL ES 3.1 effects were the main highlights.<br />\r\nBEAMS VR<br />\r\nDesigned &amp;amp; Developed, a &ldquo;Tron&rdquo; themed Infinite-terrain game for Virtual Reality on Google Cardboard<br />\r\nplatform. Complete with procedural terrain generation, dynamic events, 2-axis navigation,<br />\r\naccelerometer / gyroscope input, and many other features.<br />\r\nThis game was implemented while volunteering for TEDx, PESIT BSC - 2014 in the Design &amp;amp; Tech<br />\r\ndepartment as a part of the &ldquo;Dream-room&rdquo; concept. It was even featured with a honorary mention in<br />\r\nthe local newsletter.<br />\r\nA few other minor projects I&rsquo;ve worked on...<br />\r\no A custom designer typeface mavros.<br />\r\no Multiple Branding and UI prototypes for various start-ups, commercial projects, etc.<br />\r\no An OpenGL project for visualization of 3-Dimensional mathematical functions using a mesh with functionality such as<br />\r\nzooming, rotation, dynamic phase propagation and evolution, etc. similar to MATLAB, in C++.<br />\r\no A Hand-implemented Regular Expression / RegEx matching program using concepts learnt from Automata theory, in<br />\r\nC.<br />\r\n| TOOLS, LIBRARIES &amp;amp; FRAMEWORKS<br />\r\no Angular<br />\r\no Ionic Framework<br />\r\no Query<br />\r\no Android &ndash; Java &amp;amp; XML<br />\r\no OpenSL (Sound lib.)<br />\r\no Adobe Photoshop</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">o WebGL &amp;amp; Three.js<br />\r\no Bootstrap<br />\r\no Android NDK + JNI<br />\r\no Adobe Illustrator<br />\r\no Unity Game Engine</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">o Webpack<br />\r\no Vanilla HTML, CSS &amp;amp; JS<br />\r\no Apache Cordova<br />\r\no OpenGL (Graphics lib.)<br />\r\no Affinity Designer</span></p>\r\n\r\n<p><span style=\"font-family:Georgia; font-size:10.0000pt\">| BIO<br />\r\nFull Name Ghanashyam Sateesh<br />\r\nDOB 7 th April 1995<br />\r\nAddress #17/23, 3 rd Main, 8 th Cross, Shakambari Nagar, JP Nagar 1 st Phase, Bangalore - 560078<br />\r\nEmail ghanashyam74@gmail.com<br />\r\nPhone No. +91 97380 37548</span></p>','2019-01-29 07:13:25','2',NULL,'GD',NULL),
