. Layout JP Nagar 6</span></span><sup><span style=\"font-size:12.0000pt\"><span style=\"font-family:\'Times New Roman\'\">th</span></span></sup><span style=\"font-size:12.0000pt\"><span style=\"font-family:\'Times New Roman\'\">&nbsp;phase, Bangalore 560078.Consisting of One Bedroom, One Hall, Kitchen, Bathroom, Lavatory and RCC roofing thereon.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12.0000pt\"><span style=\"font-family:\'Times New Roman\'\">For Tenant convenience the Schedule premises is provided with two fans, Geyser, 1 cot and one almirah which will be returned to the owner in good condition at time of vacating.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12.0000pt\"><span style=\"font-family:\'Times New Roman\'\">IN WITNESS WHEREOF of the above name parties affixed their signatures to this possession Rental Agreement on this day month, and year as mentioned above written at Bangalore.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12.0000pt\"><span style=\"font-family:\'Times New Roman\'\">WITNESSES &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb