family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;of every month regularly </span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">4.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">Every year on renewal of agreement rent will be increased by 5%.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">5.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT shall also pay the electricity charges and Water charges of the schedule premises as per bills every month without keeping any arrears.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">6.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The TENANT shall under no circumstances shall sublet or underlet or in any way part with the possession of the schedule premises and Tenant will not include any other members in this present scheduled premise other than members in the agreement without written consent of the OWNER.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">7.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">In case of any damages to the schedule property the TENANT shall get it repaired at his own cost and expenses and the damages are found at the time of vacating the equivalent amount for repairing/painting will be deducted from the advance.</span></p>\r\n\r\n<p style=\"margin-left:36.0000pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">8.&nbsp;</span><!--[endif]--><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">The OWNER shall pay the annual corporation/Municipal tax of the schedule premises. </span></p>\r\n\r\n<p style=\"text-align:center\"><strong><u>S C H E D U L E</u></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">All the piece and parcel of the property bearing premises #123, ground floor Ashok Nilaya, 20</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;Cross, K.R. Layout JP Nagar 6</span><sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">th</span></sup><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;phase, Bangalore 560078.Consisting of One Bedroom, One Hall, Kitchen, Bathroom, Lavatory and RCC roofing thereon.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">For Tenant convenience the Schedule premises is provided with two fans, Geyser, 1 cot and one almirah which will be returned to the owner in good condition at time of vacating.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">IN WITNESS WHEREOF of the above name parties affixed their signatures to this possession Rental Agreement on this day month, and year as mentioned above written at Bangalore.</span></p>\r\n\r\n<p><span style=\"font-family:\'Times New Roman\'; font-size:12.0000pt\">WITNESSES &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp