:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\';font-size:12.0000pt;\">3.&nbsp;</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\">The TENANT shall pay monthly rent of Rs. 6500/- (Rupees Five thousand five hundred only) to the OWNER on or before the 10</span><sup><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;vertical-align:super;\">th</span></sup><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\">&nbsp;of every month regularly </span><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:36.0000pt;text-indent:-18.0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\';font-size:12.0000pt;\">4.&nbsp;</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\">Every year on renewal of agreement rent will be increased by 5%.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:36.0000pt;text-indent:-18.0000pt;text-align:justify;text-justify:inter-ideograph;mso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:\'Times New Roman\';font-size:12.0000pt;\">5.&nbsp;</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\">The TENANT shall also pay the electricity charges and Water charges of the schedule premises as per bills every month without keeping any arrears.</span><span style=\"mso-spacerun:\'yes\';font-family:\'Times New Roman\';font-size:12.0000pt;\"><o:p></o:p></span></p><p class=\"